const GenreSelect = () => {
    const elements = [];

    for (let i = 0; i < 26; i++) {
        elements.push(<p key={i}>{String.fromCharCode(65 + i)}</p>);
    }

    return (
        <div className="alphaBox">
            {elements}
        </div>
    )
}

export default GenreSelect;
